script: |
  super -f text -I q2208.spq | sort > q2208.out

inputs:
  - name: q2208.spq
    data: |
      SELECT DISTINCT 92 * + col0 AS col0 FROM tab2 (FORMAT parquet) WHERE col2 NOT BETWEEN - + col2 AND - col2 - + + col2;
  - name: tab2

outputs:
  - name: q2208.out
    data: |
      4232
      5888
      6900
